import React, { Component } from 'react';
import logo from '../../../src/logo.svg';
import '../Styles/App.css';
import Page from '../Javascript/Page.js'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Page />
      </div>
    );
  }
}

export default App;
